import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const AdminDashboard = () => {
  return (
    <div className="container mt-5">
      <h1>Admin Dashboard</h1>
      <p>Manage events and users here.</p>
    </div>
  );
};

export default AdminDashboard;
